2サイクルのガソリンエンジンを採用し、混合ガソリン（50：1）を使用して4時間程度使え、最大で60Aの電流を発生させる事ができます。<br>（DC12V-60Aといえば昔の軽自動車並みの発電量となります。）<br><br> <img src=" http://image.rakuten.co.jp/ainekusu/cabinet/02749100/03318947/imgrc0068703521.jpg"><br><br>
例えば、発電機の燃料を満タン（3L）にして4時間使用すれば当社製品の直流炊飯器タケルくんを6台同時に使用して合計150個のオニギリが作れる量を炊飯出来ますし、10連USB電源のユウスケくんと併用すれば最大で120台のスマートフォンを急速充電する事が可能となります。デンゾウ爺さんの登場で大きな電力を生み出す事が可能となりましたので、DC12Vで使える機器は今後も増えてくると予想されます。<br><br>
【仕様】<br>
